package Solutions

import "testing"

func Test_maxVowels(t *testing.T) {
	type args struct {
		s string
		k int
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			// Input: s = "abciiidef", k = 3
			// Output: 3
			name: "test01",
			args: args{
				s: "abciiidef",
				k: 3,
			},
			want: 3,
		},
		{
			// Input: s = "aeiou", k = 2
			// Output: 2
			name: "test02",
			args: args{
				s: "aeiou",
				k: 2,
			},
			want: 2,
		},
		{
			// Input: s = "leetcode", k = 3
			// Output: 2
			name: "test03",
			args: args{
				s: "leetcode",
				k: 3,
			},
			want: 2,
		},
		{
			name: "test04",
			args: args{
				s: "",
				k: 100000,
			},
			want: 100000,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := maxVowels(tt.args.s, tt.args.k); got != tt.want {
				t.Errorf("maxVowels() = %v, want %v", got, tt.want)
			}
		})
	}
}
